{title: Tutta mia la citt?}
{subtitle: Equipe '84}
{define: Em5+ base-fret 0 frets 0 2 2 0 1 0}

[Em]No, non ver[Em5+]rai[Em6]: l'oro[Em5+]logio [Em]nella [F#7/C#]piazza ormai corre [Am]troppo per noi[D]
[Em]So dove [Em5+]sei[Em6]: tu non [Em5+]stai cor[Em]rendo [F#7]qui da me, sei ri[Am]masta con [D]lui
[G]Le luci [G/F#]bianche nella [Em]notte [Bm7]sembrano ac[Bbm7]cese per [Am7]me:
[Cm]? tutta mia la cit[Em]t?.[Em/D#][Em/D]
{sot}
Basso: Fa Mi
{eot}

{soc}
[G]Tutta mia la cit[Bm]t?, [C]un deserto [Am7]che co[D7]nosco
[G]tutta mia la cit[Bm]t?, [Am7]questa notte un [D7]uomo piange[G]r?!
{eoc}

No, non verrai: fumo un'altra sigaretta e poi me ne andr? senza te
Porto con me un'immagine che non vedr?: tu che corri da me.
Da un'automobile che passa qualcuno grida "Va a casa"
E` tutta mia la citt?.

{soc}
[G]Tutta mia la cit[Bm]t?, [C]un deserto [Am7]che co[D7]nosco
[G]tutta mia la cit[Bm]t?, [Am7]questa notte un [D7]uomo piange[G]r?![E7]
{eoc}

